void mainImage( out vec4 O, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.y;    
    vec2 u = fragCoord/iResolution.y;    
    float t = iTime *1.3;
    uv*=5.0;
    uv.x+=t*0.2;
    vec2 c = vec2(0.5);
    vec2 fu = mod(uv,2.0)*0.5;
    uv = fract(uv)+step(fu.yx,vec2(.5))-0.5;
    //uv.x-=fu.x-0.5;
    //uv.y-=fu.y-0.5;
    float d = length(1.0*uv-.5);    
    float m = smoothstep(.5,.4,d*10.);
    uv -= c;
    vec2 e = sin(u+2.5)*1.14;
    float f = e.x;
    float angle = cos(atan(uv.x,uv.y))*4.0;
    float k = 0.5+sin((t+m)+u.x+angle*.3)*.5;
    O = vec4(k);
}
